import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <table className="titleHeader">
          <tbody>
            <tr>
              <td>
                <img
                  alt="Icon"
                  width="100"
                  src="https://api.nasa.gov/images/logo.png"
                />
              </td>
              <td width="10" />
              <td>NASA Images</td>
            </tr>
          </tbody>
        </table>
        <input style={{ fontSize: 24 }} placeholder="Type here" />
      </div>
    );
  }
}

export default App;
